import React from "react";
// import { BrowserRouter } from "react-router-dom";
// import "./index.css";
import Home from "./Home";
import About from "./About";
import Contact from "./Contact";
// import Layout from "./Layout";
import { BrowserRouter } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Home />
      <About />
      <Contact />
    </BrowserRouter>
  );
}

export default App;
